import Catalog from './components/catalog';
import About from './components/about';
import Home from './componenets/home';

function App() {
  return (
    <div className="App">
      <Navbar></Navbar>


        <h1>Welcome to Organika!</h1>

        <Catalog></Catalog>
        <Footer></Footer>
        <About></About>
    </div>
  );
}

export default App;
